,"topLineInfo":"The Vera Project Presents","promoterName":"The Vera Project Presents","sponsorName":"","sponsorImage":null,"additionalInfo":"","additionalTicketText":"","ageLimitCode":"ALL_AGES","ageLimit":"All Ages","showTypeCode":null,"showType":"","eventStatusCode":"BUY","eventStatus":"Buy","eventStatusMessage":"","ticketPurchaseUrl":"https://www.ticketfly.com/purchase/event/1367553?utm_medium=api","ticketPrice":"$6.00 - $8.00","externalTicketingUrls":[],"multiEventCartable":true,"facebookEventId":322458758131334,"facebookEventIdString":"322458758131334","headliners":[{"id":1297709,"name":"Whitney Ballen","startTime":null,"eventDescription":"She possesses a delicate voice that often reaches into the high registers. It works to her benefit, too, because it forces listeners to pay attention to her lyrics. Ballen has been a prolific songwriter and performer, playing shows with some frequency these days. That she's writing and playing lots of great songs means it shouldn't be too long before connecting with many more fans in the immediate future.","isMobileFriendly":"false","image":null,"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"http://whitneyballen.tumblr.com/","urlMySpace":"","urlFacebook":"https://www.facebook.com/pages/Whitney-Ballen-and-the-Intimates/132153980183009","urlTwitter":"","twitterScreenName":""}],"supports":[{"id":1400687,"name":"Generifus","startTime":null,"eventDescription":"Generifus is the main musical project of songwriter Spencer Sult. Generifus began performing in 2005. When he was seventeen, Sult began self-releasing music and booking west coast tours. Since then, Sult has recorded with Karl Blau and LAKE, who in turn, have also contributed to live performances and Generifus albums. Sult has lived his entire life in Washington state and currently calls Olympia home. His songs reflect the beauty found in nature and life in the Pacific Northwest, and he has taken those songs on tour all over the United States and into Japan.","isMobileFriendly":"false","image":null,"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"http://generifus.bandcamp.com/","urlMySpace":"","urlFacebook":"https://www.facebook.com/generifus/timeline","urlTwitter":"","twitterScreenName":""},{"id":1205253,"name":"Sun Dummy","startTime":null,"eventDescription":"pathological truth teller","isMobileFriendly":"false","image":{"jumbo":{"path":"http://cdn.ticketfly.com/i/00/01/60/73/35-atjmbo.jpg","width":960,"height":960},"jumbo1":{"path":"http://cdn.ticketfly.com/i/00/01/60/73/35-atjmbo1.jpg","width":960,"height":540},"large":{"path":"http://cdn.ticketfly.com/i/00/01/60/73/35-atlg.jpg","width":300,"height":300},"large1":{"path":"http://cdn.ticketfly.com/i/00/01/60/73/35-atlg1.jpg","width":300,"height":200},"medium":{"path":"http://cdn.ticketfly.com/i/00/01/60/73/35-atmd.jpg","width":200,"height":200},"medium1":{"path":"http://cdn.ticketfly.com/i/00/01/60/73/35-atmd1.jpg","width":200,"height":133},"original":{"path":"http://cdn.ticketfly.com/i/00/01/60/73/35-og.jpg","width":960,"height":960},"small":{"path":"http://cdn.ticketfly.com/i/00/01/60/73/35-atsm.jpg","width":100,"height":100},"small1":{"path":"http://cdn.ticketfly.com/i/00/01/60/73/35-atsm1.jpg","width":100,"height":67},"square":{"path":"http://cdn.ticketfly.com/i/00/01/60/73/35-sq.jpg","width":100,"height":100},"squareSmall":{"path":"http://cdn.ticketfly.com/i/00/01/60/73/35-sqsm.jpg","width":60,"height":60},"xlarge":{"path":"http://cdn.ticketfly.com/i/00/01/60/73/35-atxl.jpg","width":500,"height":500},"xlarge1":{"path":"http://cdn.ticketfly.com/i/00/01/60/73/35-atxl1.jpg","width":500,"height":334},"xxlarge":{"path":"http://cdn.ticketfly.com/i/00/01/60/73/35-atxxl.jpg","width":650,"height":650},"xxlarge1":{"path":"http://cdn.ticketfly.com/i/00/01/60/73/35-atxxl1.jpg","width":650,"height":433}},"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"https://sundummy.bandcamp.com/","urlMySpace":"","urlFacebook":"http://www.facebook.com/sundummysea","urlTwitter":"","twitterScreenName":""},{"id":1757793,"name":"Swamp meat","startTime":null,"eventDescription":"Swamp Meat bring a lazy '60s feel to their lighter, floral-patterned, psychedelic-tinged garage. Frayed and a little off, their casual approach wins. You want some harmonica in there? Put some harmonica in there. You want that high note in there, but you're not sure you can hit it? Whatever, it's great. That's seriously what makes it great. If I wanted to listen to perfectly executed vintage pop, I wouldn't. - The Stranger

Swamp Meat, Elephant Graveyard (out now, self-released, swampmeat.bandcamp.com): A new take on '60s psychedelic pop, Graveyard is all at once expansive and controlled. The first track, "Snake Eat Self," is reminiscent of some of Hendrix's trippier soundscapes like "1983 . . . (A Merman I Should Turn to Be)," while the following number, "Katie's Farm," is more of an upbeat rendering of the classic-pop mold. - Seattle Weekly

Swamp Meat 7-inch (out now, self-released, swampmeat.bandcamp.com): Swampy is an apt descriptor for this trio's latest, given their penchant for muddy, lo-fi production values and love of large-room reverb. The B-side, "Filling Up the Void," is particularly thick and languid, with both a male and female vocal buried in the marshy mix. - Seattle Weekly","isMobileFriendly":"false","image":null,"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"http://swampmeat.bandcamp.com/","urlMySpace":"","urlFacebook":"https://www.facebook.com/swampmeat/","urlTwitter":"","twitterScreenName":""}],"urlEventDetailsUrl":"http://www.ticketfly.com/event/1367553?utm_medium=api"}]}
